import React, { Component } from "react";
import { render } from "react-dom";
import Highcharts from "highcharts";
import HighchartsReact from "highcharts-react-official";
import "./App.css";

const options = {
  chart: {
    type: "spline",
  },
  title: {
    text: "My chart",
  },
  series: [
    {
      data: [1, 2, 1, 4, 3, 6],
    },
  ],
};

class App extends Component {
  constructor(props) {
    super(props);
    this.state = { data: "" };
  }

  callAPI() {
    fetch("http://localhost:9000/testAPI")
      .then((res) => res.json())
      .then((res) => {
        console.log(res["Time Series (Daily)"]);
        this.setState({ data: res });
      })
      .catch((err) => err);
  }

  componentDidMount() {
    this.callAPI();
  }
  render() {
    if(this.state.data) {
      console.log(Object.keys(this.state.data["Time Series (Daily)"]).map(date => date.replace('-', '.')))
      const getDates = () => {
        // const initialDates = Object.keys(res['TIme Series (Daily)'])
        Object.keys(this.state.data["Time Series (Daily)"]).map(date => date.replace('-', '.'))
      };
    }

    return (
      <div className="App">
        <HighchartsReact highcharts={Highcharts} options={options} />

        {/* <p className="App-intro">{this.state.apiResponse}</p> */}
      </div>
    );
  }
}

export default App;
